import typeToReducer from "type-to-reducer";
import {
  SAVE_TODO,
} from "../common/types";

const initialState = {
 todoList: []
};

export const user = typeToReducer(
  {
    [SAVE_TODO]: (state: any, action: any) => {
      todoList.push(action.pa)
    },
},initialState)

export default user;
